import React from 'react';
import './header.css'
const Header = () => {
    return (
        <div>
            <header>
                <div className="container d-flex align-center justify-between">
                    <a href="#" className="logo">
                        <img src="/.images/logo" alt=""/>

                    </a>
                    <nav className="top-nav">
                        <Link to="/" className="top-nav__item">Welcome</Link>
                        <Link to="/about" className="top-nav__item">About us</Link>
                        <Link to="/" className="top-nav__item">Menu</Link>
                        <Link to="/" className="top-nav__item">Gallery</Link>
                        <Link to="/" className="top-nav__item">Find us</Link>
                    </nav>
                </div>
            </header>
        </div>
    );
};

export default Header;
